                    {"id":$("#btnDiv .btn-primary").attr("val")},
                    function(data,status){
                        $("#textV").val(data)
                    }
                );
			})


            $('.tools input').click(function(){
                debugger
                var id = $(this).val();

                var element = $(this).parent().parent().find("#"+id);
                if(id == 'head'){
                    if(element.attr("headlight") != 'TRUE')
                        element.attr('headlight','TRUE');
                    else
                        element.attr('headlight','FALSE');
                }else{
                    if(element.attr("on") != 'TRUE')
                        element.attr('on','TRUE');
                    else
                        element.attr('on','FALSE');
                }

            })

            $('#cam a').click(function(){
                //debugger
                $("#pro .x3d:visible").find('#'+$(this).attr('id')).attr('set_bind','true')
            })
