                $('#photoGallary td').each(function(i){
                    $(this).append('<img src="'+data[i].path+'" border=0 width="150px" height="150px">');
                })
            }
        );

        function lightSwitch(id){
            debugger
            var element = $(this).parent().parent().find("#"+id);
            if(element.attr("on") != 'TRUE')
                element.attr('on','TRUE');
            else
                element.attr('on','FALSE');
        }

        function headlight()
        {
            var h = document.getElementById("head");
            if(h.getAttribute('headlight')=='true')
                h.setAttribute('headlight', 'false');
            else
                h.setAttribute('headlight', 'true');
        }

